import React, { useState } from "react";
import "../styles/Legacy.css";

const Legacy = () => {
  const [hovered, setHovered] = useState("");

  const topics = [
    { name: "Energy", desc: "Passion and drive fuel every step we take." },
    { name: "Expertise", desc: "Years of mastery create precise outcomes." },
    { name: "Execution", desc: "Turning vision into measurable results." },
  ];

  return (
    <div className="legacy-container">
      <div className="timeline">
        <div className="timeline-line"></div>

        {topics.map((topic, index) => (
          <div
            key={index}
            className="timeline-item"
            onMouse={() => setHovered(topic.name)}
            onMouseLeave={() => setHovered("")}
          >
            <div className="dot"></div>
            <p className="topic">{topic.name}</p>
            {hovered === topic.name && (
              <p className="hover-text">{topic.desc}</p>
            )}
          </div>
        ))}

        <div className="unmatched">
          <h2>Unmatched</h2>
        </div>
      </div>
    </div>
  );
};

export default Legacy;
